import React from 'react';
import Slider from 'react-slick';
import '../styles/c'; // Import the CSS file for styling
import 'slick-carousel/slick/slick.css'; // Import slick CSS
import 'slick-carousel/slick/slick-theme.css'; // Import slick theme CSS

const Carousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1, // Show one image at a time
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };

  return (
    <div className="carousel-container"> {/* Added a container for styling */}
      <Slider {...settings}>
        <div className="carousel-item">
          <img src="https://via.placeholder.com/1200x600?text=Image+1" alt="Image 1" />
        </div>
        <div className="carousel-item">
          <img src="https://via.placeholder.com/1200x600?text=Image+2" alt="Image 2" />
        </div>
        <div className="carousel-item">
          <img src="https://via.placeholder.com/1200x600?text=Image+3" alt="Image 3" />
        </div>
        <div className="carousel-item">
          <img src="https://via.placeholder.com/1200x600?text=Image+4" alt="Image 4" />
        </div>
        <div className="carousel-item">
          <img src="https://via.placeholder.com/1200x600?text=Image+5" alt="Image 5" />
        </div>
      </Slider>
    </div>
  );
};

export default Carousel;
